  `dimensions_width` decimal(10,2) DEFAULT NULL,
  `dimensions_height` decimal(10,2) DEFAULT NULL,
  `dimensions_depth` decimal(10,2) DEFAULT NULL,
  `warrantyInformation` text DEFAULT NULL,
  `shippingInformation` text DEFAULT NULL,
  `availabilityStatus` varchar(255) DEFAULT NULL,
  `returnPolicy` text DEFAULT NULL,
  `minimumOrderQuantity` int(11) DEFAULT NULL,
  `createdAt` datetime DEFAULT NULL,
  `updatedAt` datetime DEFAULT NULL,
  `barcode` varchar(255) DEFAULT NULL,
  `qrCode` varchar(255) DEFAULT NULL,
  `thumbnail` varchar(255) DEFAULT NULL,
  `ventas` int(11) DEFAULT 0,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
